import React from 'react'
import { Container, Col, Row } from 'reactstrap';
import DeleteLayout from "./Layout/DeleteModalLayout";
import EditAction from "./EditAction";

const FormatOptionLabel = ({ value, label, photo }) => {
    return (
        <Container>
            <Row>
                <EditAction buttonLabel="Edit" label={label} photo={photo} value={value} />
                <Col>
                    <DeleteLayout buttonLabel="Hapus" className={"modalHapus"} />
                </Col>
            </Row>
        </Container>
    );
};

export default FormatOptionLabel;
